import { Component } from '@angular/core';

@Component({
  selector: 'app-teachers',
  template: `
        <ul *ngFor="let teacher from teachers">
          <li>{{teacher.id}}{{teacher.name}}</li>
        </ul>
  `,
  style: []
})
export class TeachersComponent {

  teachers = [
    { 'id' : 1 , name : 'Anto'},
    { 'id' : 2 , name : 'Ramkumar'},
    { 'id' : 3 , name : 'naveen'}
  ]
}
